import uuid from 'uuid';

const memerships = [
  {
    id: uuid.v4(),
    price: '10',
    package: ['gym', '24/7 Access', '-', '-']
  },
  {
    id: uuid.v4(),
    price: '20',
    package: ['gym', '24/7 Access', '5 clases/month', '-']
  },
  {
    id: uuid.v4(),
    price: '30',
    package: ['gym', '24/7 Access', '10 clases/month', '-']
  },
  {
    id: uuid.v4(),
    price: '50',
    package: ['gym', '24/7 Access', 'unlimated clases', 'one on one training']
  }
];

export default memerships;
